/// Check if word might be confused with another word (binary search)
pub fn get_en_confusions(word: &str) -> Option<&'static [(&'static str, u64)]> {
    EN_CONFUSION_DATA
        .binary_search_by_key(&word, |(w, _)| *w)
        .ok()
        .map(|idx| EN_CONFUSION_DATA[idx].1)
}

